import React from "react";
// react plugin used to create charts
import { Line, Bar } from "react-chartjs-2";

// reactstrap components
import {
  Button,
  Card,
  CardHeader,
  CardBody,
  CardTitle,
  Container,
  Row,
  Col
} from "reactstrap";

// core components
import {
  chartAppointment,
  chartRatings,
  chartEarnings
} from "variables/charts.js";

class Benefits extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      bigChartData: "data1"
    };
  }
  setBgChartData = name => {
    this.setState({
      bigChartData: name
    });
  };
  render() {
    return (
      <>

        <Container>

          <Row>
            <Col lg="4">
              <Card>
                <CardHeader >

                  <CardTitle tag="h4"  style={{                
                    marginTop:"10px"
                }}>
                   <div style={{
                    height:"30px",
                    width:"50px",
                    alignItems:"center"                  
                }} >
                <img className="card-category" src={require("assets/img/theme/crown.png")}  />
                </div>

                  </CardTitle>
                </CardHeader>
                <CardBody >
                 <p>
                 New revenue stream and the opportunity <br />to acquire new loyal customers  <br /> <br /> 
                 </p>

                </CardBody>
              </Card>
            </Col>
            <Col lg="4">
              <Card className="card-chart">
                <CardHeader>
                  <h5 className="card-category">Last-minute Bookings</h5>
                  <CardTitle tag="h3">
                    <i className="tim-icons icon-money-coins text-success" /> 3,500€
                  </CardTitle>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                   <p>
                   Fulfilling last minutes slots
                   </p>
                  </div>
                </CardBody>
              </Card>
            </Col>
            <Col lg="4">
              <Card className="card-chart">
                <CardHeader>
                  <h5 className="card-category">Ratings</h5>
                  <CardTitle tag="h3">
                    <i className="tim-icons icon-shape-star" style={{
                      color: "#EB9A13"
                    }} />{" "}
                    4.5
                  </CardTitle>
                </CardHeader>
                <CardBody>
                  <div className="chart-area">
                    <Bar
                      data={chartRatings.data}
                      options={chartRatings.options}
                    />
                  </div>
                </CardBody>
              </Card>
            </Col>

          </Row>
          <hr />

          <h1>Earnings Summary</h1>
          <Row>
            <Col
              md="8">
              <Button color="info" size="lg" style={{
                color: "#8A8B96",
                alignItems: "center"
              }}>
                <i className="fa fa-calendar" style={{
                  position: "initial"
                }} />{"  "}
              Select Range
            </Button>
            </Col>
            <Col md="4">
              <Button color="info" size="lg" style={{
                float: 'right',
                color: "#8A8B96",
              }}>
                <i className="fa fa-download" aria-hidden="true" />{"  "}
              </Button>
            </Col>

          </Row>
        </Container>
      </>
    );
  }
}

export default Benefits;
